function check($a)
{
  if (is_numeric($a))
    return $a;
  else return check(readline('Please enter number : '));
}
function checklicense($a)
{
  $json = json_decode(explode(PHP_EOL, file_get_contents('Safa.json'))[1], true);
  if (is_array($a)) {
    if (!isset($a['result']))
      return 1;
    else {
      checklicense(readline('Please enter license correctly : '));
    }
  }
  if (strlen($a) == 26) {
    $res = connect('https://api.cloudflareclient.com/v0a977/reg' . $json['id'] . '/account', array('User-Agent: okhttp/3.12.1', 'Content-Type: application/json', 'Authorization: Bearer ' . $json['token']), 'PUT', array('license' => $a));
    if (checklicense(json_decode($res, true)) == 1) {
      $json['license'] = $a;
      file_put_contents('Safa.json', 'DON\'T CHANGE THIS FILE' . PHP_EOL . json_encode($json));
      echo 'License submitted' . PHP_EOL;
      return;
    }
  } else return checklicense(readline('Please enter license correctly : '));
}
function connect($url, $header, $method = null, $data = null, $proxy = null, $proxytype = null)
{
  $ch = curl_init($url);
  curl_setopt_array($ch, [
    CURLOPT_HTTPHEADER => $header,
    CURLOPT_SSLVERSION => CURL_SSLVERSION_MAX_TLSv1_1,
    CURLOPT_USERAGENT => 'okhttp/3.12.1',
    CURLOPT_FOLLOWLOCATION => true,
    CURLOPT_RETURNTRANSFER => true
  ]);
  ($method) ? curl_setopt($ch, CURLOPT_CUSTOMREQUEST, $method) : null;
  ($data) ? curl_setopt($ch, CURLOPT_POSTFIELDS, json_encode($data)) : null;
  if ($proxy) {
    $int = str_ireplace(['http', 'https', 'socks4', 'socks5', 'socks4a'], [0, 2, 4, 5, 6], $proxytype);
    curl_setopt_array($ch, array(
      CURLOPT_PROXYTYPE => $int,
      CURLOPT_PROXY => $proxy
    ));
  }
  $res = curl_exec($ch);
  curl_close($ch);
  return $res;
}
